  false,\n\t\"url\": null,\n\t\"notes\": \"Terrapoint collected LiDAR for over 177
  square kilometers of the Bombay Hook National Wildlife Refuge in Kent County, Delaware.
  The nominal pulse spacing for this project was no greater than 0.75 meters. This
  project was collected with a sensor which collects waveform data and provides an
  intensity value for each discrete pulse extracted from the waveform. GPS Week Time,
  Intensity, Flightline and echo number attributes were provided for each LiDAR point.
  Dewberry used proprietary procedures to classify the LAS according to project specifications:
  1-Unclassified, 2-Ground, 7-Noise, 9-Water, 12-Overlap. Once the data was received
  by NOAA OCM, all of the class 7 (noise) points were removed from the data set. Dewberry
  produced classified LAS and DEMs for the 99 tiles (1700 m x 1700 m) that cover the
  project area.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
